function HomePage() {
  //const navigate = useNavigate();

  function navigateHandler() {
    navigate("/products");
  }

  return (
    <>
      <h1>My Home Page</h1>
      <p>
        Go to <Link to="products">the list of products</Link>.
      </p>
      <p><button>Navigate</button></p>
    </>
  );
}

export default HomePage;
